import React, {Component} from 'react';

class Product extends Component {
    render() {
        return (
            <div>
                <ul>
                    <li>企业基础OA</li>
                    <li>企业商务邮箱</li>
                    <li>企业共享云盘</li>
                    <li>企业商旅服务</li>
                    <li>企业财务系统</li>
                    <li>企业传书</li>
                    <li>企业基础服务</li>
                    <li>企业基础服务</li>
                </ul>
            </div>
        );
    }
}

export default Product;
